import React from "react";

const HomePresenter: React.VFC = () => {
	return (
		<div className="container container--home">
			<div className="content-wrap">
				<div className="tag-group">
					태그가 들어갈 자리
				</div>
			</div>
		</div>
	);
};

export default HomePresenter;
